Resident Evil: Afterlife (2010) 

Vanaf 23 september in de bioscoop 

Verenigd Koninkrijk / Duitsland / Verenigde Staten
Actie / Horror
90 minuten

geregisseerd door Paul W.S. Anderson
met Milla Jovovich, Wentworth Miller en Ali Larter

Dutch:
De wereld wordt nog steeds geteisterd door het virus dat mensen in zombies veranderd. Alice (Milla Jovovich) blijft op haar pad toch steeds meer overlevenden vinden en samen zoeken ze naar een veilige haven. In haar gevecht met de 'Umbrella Corporation' krijgt Alice onverwachte hulp van een oude bekende.

English:
In a world ravaged by a virus infection, turning its victims into the Undead, Alice (Jovovich), continues on her journey to find survivors and lead them to safety. Her deadly battle with the Umbrella Corporation reaches new heights, but Alice gets some unexpected help from an old friend. A new lead that promises a safe haven from the Undead takes them to Los Angeles, but when they arrive the city is overrun by thousands of Undead - and Alice and her comrades are about to step into a deadly trap.

